import React, {Component} from 'react';
import {sendInputValue} from "./api/InputValues";

class Auth extends Component {
    render() {
        return (
            <div>
                <p>
                  <input id="name"/>
                </p>
                <p>
                  <input id="surname"/>
                </p>
                <p>
                  <input id="email"/>
                </p>
                <p>
                  <input id="password"/>
                </p>
                <form action="new.html" target="_blank">
                    <button onClick={this.clickHandler} >
                        Зарегистрироваться
                    </button>
                </form>
            </div>
        );
    }   
}

export default App;
